Система ввода-вывода

Система ввода-вывода Java представляет собой группу классов, позволяющих работать как со множеством различных источников и приемников данных, так и с различными формами обмена данными. В качестве источников и приемников информации могут использоваться, например, файлы, консоль или сетевые соединения. Обмен данными между источником и приемником может быть, например, двоичным или символьным, буферизованным, с последовательным или произвольным доступом.
Система ввода-вывода Java расположена в библиотеках java.io и java.nio.
В библиотеках ввода-вывода используется абстракция потока (stream). Поток ввода-вывода – произвольный источник или приемник данных, который способен производить или получать некоторую информацию. Поток скрывает подробности низкоуровневых операций, выполняемых с данными непосредственно в устройствах ввода-вывода. Классы, осуществляющие ввод данных, наследуются от базовых классов InputStream или Reader. Классы для ввода данных наследуются от базовых классов OutputStream или Writer.

InputStream является базовым для классов, которые получают данные из различных источников.
Основные подклассы InputStream:
    • FileInputStream – используется для чтения информации из файла;
    • StringBufferInputStream – использует строку каквходной набор данных;
    • ByteArrayInputStream – использует буфер (массив байт) в памяти в качестве источника данных для входного потока;
    • PipedInputStream – производит данные, которые были записаны в соответствующий выходной поток PipedOutputStream (реализует концепцию канала данных);
    • SequenceInputStream – соединяет два или более потока InputStream в единый поток.
    • int read() – возвращает целочисленное представление следующего байта в потоке (-1, если нет доступных для чтения байтов);
    • int read(byte[] buffer) – считывает байты из потока в массив buffer. После чтения возвращает число считанных байтов (-1, если ни одного байта не было считано);
    • int read(byte[] buffer, int offset, int length)– считывает некоторое количество байтов, равное length, из потока в массив buffer. При этом считанныe байты помещаются в массиве, начиная со смещения offset (с элемента buffer[offset]. Метод возвращает число успешно прочитанных байтов;
Основные методы
    • int available() – возвращает количество байтов, доступных для чтения в потоке;
    • void close() – закрывает поток;
    • long skip(long number) – пропускает в потоке при чтении некоторое количество байт, которое равно number. 
Перечисленные методы могут возбуждать исключение IOException. Спецификация данного исключения включена в спецификацию методов. InputStream. Основные методы OutputStream является базовым для классов, определяющих, куда направляются подготовленные для вывода данные.

Основные подклассы OutputStream:
    • FileOutputStream – используется для записи данных вфайл на диске;
    • ByteArrayOutputStream – создает буфер в памяти. Все данные, посылаемые в этот поток, размещаются в созданном буфере;
    • PipedOutputStream – все данные, записанные в поток, автоматически появляются в ассоциированным с ним входном потоке PipedInputStream (реализует концепцию канала данных).

OutputStream
    • void close() – закрывает поток;
    • void flush() – очищает буфер вывода, записывая все его содержимое;
    • void write(int b) – записывает в выходной поток один байт (младший байт b);
    • void write(byte[] buffer) – записывает в выходной поток массив байтов buffer;
    • void write(byte[] buffer, int offset, int
length) – записывает в выходной поток некоторое число байтов, равное length, из массива buffer, начиная со смещения offset, то есть с элемента
buffer[offset].
OutputStream. 

Классы InputStream, OutputStream и их подклассы практически не используются для организации вводавывода данных напрямую. Объекты потоков редко создаются на основе одного класса; чаще несколько объектов «наслаиваются» друг на друга для получения необходимой функциональности. Добавление необходимых атрибутов и интерфейсов в базовой системе ввода-вывода Java осуществляется с помощью абстрактных классов-«фильтров» FilterInputStream и FilterOutputStream, которые являются основой и предоставляют базовые интерфейсы для классов-«декораторов»

Декораторы

Декоратор — это структурный паттерн проектирования, который позволяет динамически добавлять объектам новую функциональность. Декоратор должен обладать таким же интерфейсом, как и «декорируемый» объект, но также расширяет его добавлением новых атрибутов и методов. Декораторы предоставляют дополнительную гибкость в разработке, но усложняет код. Причина запутанности библиотеки ввода-вывода Java состоит в том, что для получения желаемого объекта приходится создавать много дополнительных объектов – «ядро» ввода-вывода и набор декораторов. Классы-«декораторы» наследуются от FilterInputStream и FilterOutputStream.

    • DataInputStream – используется в сочетании с классом DataOutputStream, позволяет читать различные типы простейших данных и строки из потока без привязки к платформе;
    • BufferedInputStream – используется для предотвращения физического чтения с устройства при каждом новом запросе (делает поток буферизованным);
    • LineNumberInputStream – ведет подсчет прочитанных из потока строк;
    • PushbackInputStream – имеет односимвольный буфер, который позволяет помещать в поток только что считанный символ.

Подклассы FilterInputStream

    • DataOutputStream – используется в сочетании с классом DataInputStream, позволяет записывать в поток примитивы и строки из потока независимо от платформы;
    • PrintStream – используется для форматирования данных при выводе. В отличие от DataOutputStream отвечает не за хранение данных в заданной форме, а за их отображение (основные методы – print() и println());
    • BufferedOutputStream – используется для буферизации вывода, то есть для предотвращения прямой записи в устройство каждый раз при записи данных. Для записи содержимого буфера в устройство используется метод flush().
Для поддержки интернационализации программ в Java была введена иерархия классов Reader и Writer. Эти классы отвечают за корректное использование символов Unicode в операциях ввода-вывода. Кроме этого новые классы работают быстрее «байтовых» классов. Практически у всех изначальных потоковых классов имеются соответствующие классы Reader и Writer со схожими функциями, но работающие с символами Unicode. «Байтовые» классы могут быть преобразованы в «символьные» классами-адаптерами InputStreamReader и OutputStreamWriter.

