RandomAccessFile

Предназначен для работы с файлами, содержащими записи известного размера, по которым можно перемещаться с последующим чтением или записью данных. RandomAccessFile не является частью иерархии базовой системы ввода-вывода (кроме реализации интерфейсов DataInput и DataOutput). В конструктор данного класса передается также строка, устанавливающая порядок использования файла:
    • "r" – только для чтения;
    • "rw" – для чтения и записи.

RandomAccessFile. Основные методы

    • long getFilePointer() – возвращает текущее смещение (количество байт) в файле;
    • long length() – возвращает длину файла в байтах;
    • void setLength (long newLength) – устанавливает длину файла. Если текущая длина файла больше, чем значение newLength, то файл будет усечен (если меньше – расширен);
    • void seek(long pos) – устанавливает смещение указателя файла от начала в позицию pos (в байтах).
Предназначен для представления файлов и каталогов независимо от используемой файловой системы. Используют для получения информации о характеристиках файлов, создания и удаления файлов и каталогов. Конструкторы класса ассоциируют создаваемые объекты с каталогами или файлами по заданному пути (строка). Например:
File file = new File("src/ioex");
File основные методы:
    • String getName() – возвращает имя файла (каталога);
    • String getParent() – возвращает имя родительского каталога;
    • String getPath() – возвращает путь к файлу (каталогу) в виде строки;
    • String getAbsolutePath() – возвращает полный (абсолютный) путь к файлу (каталогу);
    • boolean isAbsolute() – проверяет, представляет ли объект абсолютный путь;
    • boolean isDirectory() – проверяет, представляет ли объект каталог;
    • boolean isFile() – проверяет, представляет ли объект файл;
    • boolean canRead() – проверяет, доступен ли файл для чтения;
    • boolean canWrite() – проверяет, доступен ли файл для записи;
    • boolean exists() – проверяет, существует ли файл;
    • long lastModified() – возвращает время последнего изменения файла или каталога (количество миллисекунд, прошедших с начала эпохи Unix);
    • long length() – возвращает длину файла в байтах;
    • boolean createNewFile() – создает новый файл по пути, который передан в конструктор;
    • boolean mkdir() – создает новый каталог и при удачном создании возвращает значение true;
    • String[] list() – возвращает массив файлов и подкаталогов, которые находятся по представляемому объектом пути;
    • boolean renameTo(File dest) – переименовывает файл или каталог в соответствии с новым именем, представленным в dest;
    • boolean delete() – удаляет каталог или файл по пути, который передан в конструктор.
